    _playAni: function() {
        var _speed = 15;


        this._proback1.x -= _speed;
        this._proback2.x -= _speed;
        this._proback3.x -= _speed;

        if(this._proback1.x < -320){
            this._proback1.x = 980 + 640;
        }

        if(this._proback2.x < -320){
            this._proback2.x = 980 + 640;
        }

        if(this._proback3.x < -320){
            this._proback3.x = 980 + 640;
        }

        if(this._proback1.x < this._proback2.x)
        {
            this._proback2.x = this._proback1.x + 640;
        }

        if(this._proback2.x < this._proback3.x)
        {
            this._proback3.x = this._proback2.x + 640;
        }

        if(this._proback3.x < this._proback1.x)
        {
            this._proback1.x = this._proback3.x + 640;
        }
    },



